import React, { FunctionComponent, useEffect, useRef, useState } from "react";
import AppHeader from "../../accessories/appHeader/AppHeader";
import Footer from "../../accessories/footer/Footer";
import Button from "@material-ui/core/Button";
import Modal from "@material-ui/core/Modal";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import List from '@material-ui/core/List';
import Paper from '@material-ui/core/Paper';
import { useTranslation } from "react-i18next";
import { connect, useDispatch } from "react-redux";
import { Redirect } from "react-router";
import { IState } from "../../../types";
import { useFormik } from "formik";
import TextField from "../../accessories/textField/TextField";
import { BillDTO, PatientDTO } from "../../../generated";
import { FullBillDTO } from "../../../generated";
import { scrollToElement } from "../../../libraries/uiUtils/scrollToElement";
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import "./styles.scss";
import SearchIcon from "../../../assets/SearchIcon";

import {
    createBill,
    createBillReset,
} from "../../../state/bills/actions";

import {
    searchPatient,
    getPatientSuccess,
} from "../../../state/patients/actions";

import {
    IDispatchProps,
    IStateProps,
    TActivityTransitionState,
    TProps,
    TValues,
} from "./types";
import patientDTO from "../../../mockServer/fixtures/patientDTO";


const NewBillActivity: FunctionComponent<TProps> = ({
    userCredentials,
    isLoading,
    hasSucceeded,
    getMed,
    createBill,
    createBillReset,
    hasFailed,
    billHomeRoute,
}) => {
    const { t } = useTranslation();

    const breadcrumbMap = {
        [t("nav.dashboard")]: "/",
        [t("nav.billing")]: "/billing",
        [t("nav.newbill")]: "/bills",
    };

    //
    //Gestione Modal
    //
    const [open, setOpen] = React.useState(false);
    const handleOpen = () => {
        setOpen(true);
    };
    const handleClose = () => {
        setOpen(false);
    };
    const body = (
        <div>
            <p>ciao</p>
        </div>
    )
    //
    //


    return (
        <div className="new_Bill">
            <AppHeader
                userCredentials={userCredentials}
                breadcrumbMap={breadcrumbMap}
            />
            <div className="newBill__background">
                <div className="newBill__content">
                    <div className="newBill__title">{t("nav.newbill")}</div>
                    <div className="newBill__panel">
                        <div className="table">
                            <div className="container">
                                <form>
                                    <div className="bill_DatePat">
                                        <label>data</label>
                                        <input type="date"></input>
                                        <label>paziente</label>
                                        <input type="text"></input>
                                    </div>
                                </form>
                            </div>
                            <TableContainer component={Paper}>
                                <Table className="bill_Table" size="small" aria-label="a dense table">
                                    <TableHead>
                                        <TableRow>
                                            <TableCell>Total</TableCell>
                                            <TableCell align="right"></TableCell>
                                            <TableCell align="right"></TableCell>
                                            <TableCell align="right"></TableCell>
                                            <TableCell align="right">0</TableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                        <TableRow>
                                            <TableCell component="th" scope="row">
                                            </TableCell>
                                            <TableCell align="right">1</TableCell>
                                            <TableCell align="right">2</TableCell>
                                            <TableCell align="right">3</TableCell>
                                            <TableCell align="right">4</TableCell>
                                        </TableRow>
                                        <TableRow>
                                            <TableCell component="th" scope="row">
                                            </TableCell>
                                            <TableCell align="right">1</TableCell>
                                            <TableCell align="right">2</TableCell>
                                            <TableCell align="right">3</TableCell>
                                            <TableCell align="right">4</TableCell>
                                        </TableRow>
                                        <TableRow>
                                            <TableCell component="th" scope="row">
                                            </TableCell>
                                            <TableCell align="right">1</TableCell>
                                            <TableCell align="right">2</TableCell>
                                            <TableCell align="right">3</TableCell>
                                            <TableCell align="right">4</TableCell>
                                        </TableRow>
                                        <TableRow>
                                            <TableCell component="th" scope="row">
                                            </TableCell>
                                            <TableCell align="right">1</TableCell>
                                            <TableCell align="right">2</TableCell>
                                            <TableCell align="right">3</TableCell>
                                            <TableCell align="right">4</TableCell>
                                        </TableRow>
                                        <TableRow>
                                            <TableCell component="th" scope="row">
                                            </TableCell>
                                            <TableCell align="right">1</TableCell>
                                            <TableCell align="right">2</TableCell>
                                            <TableCell align="right">3</TableCell>
                                            <TableCell align="right">4</TableCell>
                                        </TableRow>
                                    </TableBody>
                                </Table>
                            </TableContainer>

                            <Drawer
                                className="x"
                                variant="permanent"
                                anchor="right"
                            >
                                <Divider />
                                <List>
                                    {['Medical', 'Operation', 'Exam ', 'Other'].map((text, index) => (
                                        <ListItem button key={text}>
                                            <ListItemIcon></ListItemIcon>
                                            <ListItemText primary={text} />
                                        </ListItem>
                                    ))}
                                </List>
                                <Divider />
                            </Drawer>
                        </div>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}


const mapStateToProps = (state: IState): IStateProps => ({
    userCredentials: state.main.authentication.data,
    isLoading: state.bills.createBill.status === "LOADING",
    hasSucceeded: state.bills.createBill.status === "SUCCESS",
    hasFailed: state.bills.createBill.status === "FAIL",
    getMed: state.medicals.medicalsOrderByName.data,
});




const mapDispatchToProps: IDispatchProps = {
    createBill,
    createBillReset,

};

export default connect(mapStateToProps, mapDispatchToProps)(NewBillActivity);
